import React, { useState } from 'react'
import { useDispatch, useSelector } from 'react-redux';



const CheckoutShipping = () => {



    const state = useSelector((s) => s.controlItems);
    const dispatch = useDispatch();

    const ShippingVisitForm = () => {
        const [name, setName] = useState('');
        const [lastName, setLastName] = useState('');
        const [rut, setRut] = useState('');
        const [phone, setPhone] = useState('');
        const [email, setEmail] = useState('');
        const [address, setAddress] = useState('');
        const [address2, setAddress2] = useState('');
        const [city, setCity] = useState('');
        const [region, setRegion] = useState('');
        const [postalCode, setPostalCode] = useState('');
        const [additional, setAdditional] = useState('');

        const proccessPay =async (e) => {
            e.preventDefault();
    
            console.log(name);
            console.log(lastName);
            console.log(rut);
            console.log(phone);
            console.log(email);
            console.log(address);
            console.log(address2);
            console.log(city);
            console.log(region);
            console.log(postalCode);
            console.log(additional);
    
        }
        return (
            <div  onSubmit={proccessPay}>
                <div className='py-1 text-center'>
                    <h4>Información de envío</h4>
                </div>
                <div className='py-2'>
                    <form className="row g-3">
                        <div className="col-md-6">
                            <label htmlFor="inputEmail4" className="form-label">Nombre</label>
                            <input type="text" className="form-control" id="inputNameVisit" required onChange={async(e) => setName(e.target.value)} />
                        </div>
                        <div className="col-md-6">
                            <label htmlFor="inputPassword4" className="form-label">Apellidos</label>
                            <input type="text" className="form-control" id="inputLastNameVisit" onChange={(e) => setLastName(e.target.value)} />
                        </div>
                        <div className="col-md-6">
                            <label htmlFor="inputEmail4" className="form-label">Rut</label>
                            <input type="text" className="form-control" id="inputRutVisit" onChange={(e) => setRut(e.target.value)} />
                        </div>
                        <div className="col-md-6">
                            <label htmlFor="inputPassword4" className="form-label">Teléfono</label>
                            <input type="text" className="form-control" id="inputPhoneVisit" onChange={(e) => setPhone(e.target.value)} />
                        </div>
                        <div className="col-12">
                            <label htmlFor="inputAddress" className="form-label">E-mail</label>
                            <input type="email" className="form-control" id="inputEmailVisit" onChange={(e) => setEmail(e.target.value)} />
                        </div>

                        <div className="col-12">
                            <label htmlFor="inputAddress" className="form-label">Dirección</label>
                            <input type="text" className="form-control" id="inputAddressVisit" placeholder="Av. Central 622" onChange={(e) => setAddress(e.target.value)} />
                        </div>
                        <div className="col-12">
                            <label htmlFor="inputAddress2" className="form-label">Dirección 2</label>
                            <input type="text" className="form-control" id="inputAddress2Visit" placeholder="Departamento, oficina, piso." onChange={(e) => setAddress2(e.target.value)} />
                        </div>
                        <div className="col-md-6">
                            <label htmlFor="inputCity" className="form-label">Ciudad</label>
                            <input type="text" className="form-control" id="inputCityVisit" onChange={(e) => setCity(e.target.value)} />
                        </div>
                        <div className="col-md-4">
                            <label htmlFor="inputState" className="form-label">Región</label>
                            <select id="inputStateVisit" className="form-select" defaultValue='Elige...' onChange={(e) => setRegion(e.target.value)}>
                                <option>Elige...</option>
                                <option>Antofagasta</option>
                                <option>Arica y Parinacota</option>
                                <option>Atacama</option>
                                <option>Aysén</option>
                                <option>Biobío</option>
                                <option>Coquimbo</option>
                                <option>La Araucanía</option>
                                <option>Los Lagos</option>
                                <option>Los Ríos</option>
                                <option>Magallanes</option>
                                <option>Maule</option>
                                <option>Metropolitana</option>
                                <option>Ñuble</option>
                                <option>O'Higgins</option>
                                <option>Tarapacá</option>
                                <option>Valparaíso</option>
                            </select>
                        </div>
                        <div className="col-md-2">
                            <label htmlFor="inputZip" className="form-label">N° Postal</label>
                            <input type="text" className="form-control" id="inputPostalVisit" onChange={(e) => setPostalCode(e.target.value)} />
                        </div>
                        <div className="col-12">
                            <div className="mb-3">
                                <label htmlFor="exampleFormControlTextarea1" className="form-label">Comentarios de envío</label>
                                <textarea className="form-control" id="inputAdditionalVisit" onChange={(e) => setAdditional(e.target.value)} rows="3"></textarea>
                            </div>
                            <div>
                                <button className="btn btn-outline-primary">

                                </button>
                            </div>
                        </div>
                    </form>
                </div>
            </div>
        );
    }

    const AddAdrressForm = () => {
        return (
            <>
                <div className='py-1 text-center'>
                    <h4>Información de envío</h4>
                </div>
                <div className='py-2'>
                    <form className="row g-3">


                        <div className="col-12">
                            <label htmlFor="inputAddress" className="form-label">Dirección</label>
                            <input type="text" className="form-control" id="dasddsa" placeholder="Av. Central 622" />
                        </div>
                        <div className="col-12">
                            <label htmlFor="inputAddress2" className="form-label">Dirección 2</label>
                            <input type="text" className="form-control" id="inpudastAddrdaess2" placeholder="Departamento, oficina, piso." />
                        </div>
                        <div className="col-md-6">
                            <label htmlFor="inputCity" className="form-label">Ciudad</label>
                            <input type="text" className="form-control" id="asdssss" />
                        </div>
                        <div className="col-md-4">
                            <label htmlFor="inputState" className="form-label">Región</label>
                            <select id="inputStsssate" className="form-select" defaultValue='Elige...'>
                                <option>Elige...</option>
                                <option>Antofagasta</option>
                                <option>Arica y Parinacota</option>
                                <option>Atacama</option>
                                <option>Aysén</option>
                                <option>Biobío</option>
                                <option>Coquimbo</option>
                                <option>La Araucanía</option>
                                <option>Los Lagos</option>
                                <option>Los Ríos</option>
                                <option>Magallanes</option>
                                <option>Maule</option>
                                <option>Metropolitana</option>
                                <option>Ñuble</option>
                                <option>O'Higgins</option>
                                <option>Tarapacá</option>
                                <option>Valparaíso</option>
                            </select>
                        </div>
                        <div className="col-md-2">
                            <label htmlFor="inputZip" className="form-label">N° Postal</label>
                            <input type="text" className="form-control" id="inpuasdasstZip" />
                        </div>
                        <div className="col-12">
                            <div className="mb-3">
                                <label htmlFor="exampleFormControlTextarea1" className="form-label">Comentarios de envío</label>
                                <textarea className="form-control" id="exampaaleFormssadControlTextarea1" rows="3"></textarea>
                            </div>
                        </div>

                    </form>
                </div>
            </>
        );
    };
    const cardAddres = (address) => {
        console.log(address)
        return (
            <div className='col py-3'>
                <div className="card" style={{ width: 15 + 'rem' }}>
                    <div className="card-body">
                        <input className="form-check-input me-1" type="radio" name="listGroupRadio_cardAddres" value="" id="firstRaasdio" />
                        <h5 className="card-title py-2">{address.alias.toUpperCase()}</h5>
                        <h6 className="card-subtitle fw-bold mb-2 text-muted">{address.direccion}, {address.direccion2}, {address.region}, {address.country}</h6>
                        <h6 className="card-subtitle mb-2 text-muted ">{address.codigo != null && address.codigo !== '' ? `Código postar: ${address.codigo}` : 'Código postar: 4123'}</h6>
                        <p className="card-text py-3 text-muted">{address.aditional}</p>
                    </div>
                </div>
            </div>
        );
    };

    const UserComplete = (props) => {
        const user = props.user;
        return (
            <>
                <div className="container">

                    <div className='col-md-7 col-lg-9 mx-auto'>
                        <ul className="list-group mb-3">
                            <h3 className='text-center'>
                                Datos de envío
                            </h3>

                            <li className="list-group-item d-flex justify-content-between bg-light">
                                <span>Nombre:</span>{user.name} {user.lastName}
                            </li>
                            <li className="list-group-item d-flex justify-content-between bg-light">
                                <span>Rut </span> {user.rut}
                            </li>
                            <li className="list-group-item d-flex justify-content-between bg-light">
                                <span>Teléfono </span> {user.phone}
                            </li>
                        </ul>
                    </div>
                </div>
            </>
        );
    };
    const UserForm = (props) => {
        const user = props.user;

        return (
            <>
                <div className='py-1 text-center'>
                    <h4>Información personal</h4>
                </div>
                <div className='py-2'>
                    <form className="row g-3">
                        <div className="col-md-6">
                            <label htmlFor="inputEmail4" className="form-label">Nombre</label>
                            <input type="text" className="form-control" id="inputEmail4s" defaultValue={user.name != null && user.name} disabled={user.name != null && user.name !== ''} />
                        </div>
                        <div className="col-md-6">
                            <label htmlFor="inputPassword4" className="form-label">Apellidos</label>
                            <input type="text" className="form-control" id="inputPassword4dd" defaultValue={user.lastName != null && user.lastName} disabled={user.lastName != null && user.lastName !== ''} />
                        </div>
                        <div className="col-md-6">
                            <label htmlFor="inputEmail4" className="form-label">Rut</label>
                            <input type="text" className="form-control" id="inputEmail4q" defaultValue={user.rut != null && user.rut} disabled={user.rut != null && user.rut !== ''} required />
                        </div>
                        <div className="col-md-6">
                            <label htmlFor="inputPassword4" className="form-label">Teléfono</label>
